import React, { Component } from 'react';

class Ead extends Component {
    render() {
        return (
        <div id="nav">
            <ul>
                <a href="/learn"><li>learn</li></a>
                <a href="/test"><li>test</li></a>
                <a href="/teacher"><li>teachers</li></a>
                <a href="/student"><li>students</li></a>
            </ul>
        </div>
        );
    }
}
export default Head;
